// Add a click event listener to the button

  // Check if the browser supports the full-screen API
  if (iframe.requestFullscreen) {
    iframe.requestFullscreen();
  } else if (iframe.webkitRequestFullscreen) { /* Safari */
    iframe.webkitRequestFullscreen();
  } else if (iframe.msRequestFullscreen) { /* IE11 */
    iframe.msRequestFullscreen();
  }
});
</script>

  <iframe id="rame" src="https://www.primarygames.com/arcade/action/run/mobile/" width="800" height="500"></iframe> 

    <button id="fullsc-button">Enter Fullscreen</button>
<script>// Get references to the iframe and the button
  const ibrame = document.getElementById('rame');
  const fullscButton = document.getElementById('fullsc-button');

  // Add a click event listener to the button
  fullscButton.addEventListener('click', () => {
    // Check if the browser supports the full-screen API
    if (ibrame.requestFullscreen) {
      ibrame.requestFullscreen();
    } else if (ibrame.webkitRequestFullscreen) { /* Safari */
      ibrame.webkitRequestFullscreen();
    } else if (ibrame.msRequestFullscreen) { /* IE11 */
      ibrame.msRequestFullscreen();
    }
  });
</script>
